import React, { Component } from 'react';
import './App.css';
import Header from './Header';
import Filters from './Filters';
import Products from "./Products";
import Card from './Card';
import Footer from './Footer';


class App extends Component {


  render() {
    return (
      <div className="App">
       <Header />
       <div className="wrapper">
         <div className="filtersLinks">
            <Filters show="Show All" male="Male" female="Female" legrand="LE-GRAND-BIKES" kross="KROSS" explorer="EXPLORER" visitor="VISITOR" pony="PONY" force="FORCE" ebikes="E-BIKES" ideal="IDEAL"/>
         </div>
         <div className="bikess">

         </div>
       </div>
        <Footer />
      </div>
    );
  }
}

export default App;
